/** @format */
import React, { useEffect, useReducer, useState } from "react";
import { useNavigate } from "react-router-dom";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";
import axios from "axios";
import { ResultValue } from "./Result";

import "./App.css";

export const baseUrl = "http://localhost:8080";


const style = {
  position: "absolute",
  top: "40%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 400,
  bgcolor: "background.paper",
  boxShadow: 24,
  p: 4,
  textAlign: "center",
};

const AppModal = ({ open, handleClose, title, description, children }) => {
  return (
    <Modal
      open={open}
      handleClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <Box sx={style}>
        <Typography id="modal-modal-title" variant="h6" component="h2">
          {title}
        </Typography>
        <Typography id="modal-modal-description" sx={{ mt: 2 }}>
          {description}
        </Typography>
        <div>{children}</div>
      </Box>
    </Modal>
  );
};

const Content = () => {
  const [open, setOpen] = useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);
  const navigate = useNavigate();
  const [userData, setUserData] = useState();
  const [formInput, setFormInput] = useReducer(
    (state, newState) => ({ ...state, ...newState }),
    {
      symptoms: "",
      gender: "",
      yearOfBirth: "",
      token: "",
    }
  );

  const handleSubmit = (e) => {
    e.preventDefault();

    const data = {
      symptoms: formInput.symptoms,
      gender: formInput.gender,
      yearOfBirth: Number(formInput.yearOfBirth),
      token:
        "eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..oxdrlbJxHrwr51cRiFE5GYbsEHQqAir5-Q4APh8Aqv4",
    };

    axios
      .post(`${baseUrl}/diagonise`, data)
      .then(
        (res) => (res.status === 200 && handleOpen(), setUserData(res.data)
        )
      )

      .catch((e) => (e, console.log(e, "Error")));
  };


  const handleInput = (event) => {
    const name = event.target.name;
    const newValue = event.target.value;
    setFormInput({ [name]: newValue });
  };

  console.log(userData, 'userdata')

  return (

    {

    }
  );

};


function App() {
  return (
    <div className="App">
      <div className="header">
        <h1>The best place to diagnose your health</h1>
      </div>
      <Content />

    </div>
  );
}

export default App;
